import { Pie } from 'react-chartjs-2';
import {
    Chart as ChartJS,
    ArcElement,
    Tooltip,
    Legend
} from 'chart.js';
import {  PieChartData } from '../../data/SampleData';

ChartJS.register(
    Tooltip,
    Legend,
    ArcElement
);
const PieChart=()=>{
    const options={}
    return<Pie options={options} data={PieChartData}/>
}
export default PieChart;
